"use client";
import logo from './goodlogo.png';
import './App.css';
import React from 'react';
import { Input } from "@/components/ui/input"

function App() {
  return (
    <div class="backround">
        <header>
            <nav>
                <img src={logo} alt="Better Notes Logo" className="logo" />
                <ul>
                    <li>
                        <a href="about.html">Benefits</a>
                    </li>
                    <li>
                        <a href="login.html">Log In</a>
                    </li>
                </ul>
            </nav>
        </header>
        <div class="title">
            <h1>Better Notes</h1>
            <h2>We use Ai to help student stay organized and take better notes</h2>
        </div>
        <div class="signup">
            <Input />
        </div>
    </div>
  );
}







export default App;
